import React from 'react';
import { useState } from "react";
import { common  } from "../common/common";

const Login = () => {

  //variables whose value can change during runtime
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [task, setTask] = useState("");
  const lng = common.lng;

  /** validate import fields
	* if OK submit form
	* else show errorMsg, set error class, set focus
	* @return void 
  */	
  const handleLogin = () => {

  };

  return (
		<div id="login" className="form">
			{(task === 'regist') &&
				( <p>Regist</p>)
			}
			<div className="row text-center">
				<h1>
						<em className="fas fa-sign-in-alt"></em>&nbsp;
						<span>{ lng('LOGIN') }</span>
				</h1>
			</div>	
			<form name="login" action="index.php" method="post" 
				id="formLogin">
				<div className="row text-center">
					<div className="col-12">
						<em className="fas fa-user"></em>&nbsp;
						<label>{ lng('NICKNAME_OR_EMAIL') }</label><br />
						<input type="text" name="email" id="email" value={ email }
							onChange={(e) => setEmail(e.target.value)} autoFocus
							required />
					</div>	
				</div>	
				<div className="row text-center">
					<div className="col-12">
						<em className="fas fa-key"></em>&nbsp;
						<label>{ lng('PASSWORD') }</label><br />
						<input type="password" name="password" value={ password }
								onChange={(e) => setPassword(e.target.value)}
								required />
					</div>
				</div>	
				<div className="row text-center">
					<div className="col-12">
						<a href="valami" target="_new">{ lng('ACCEPT1') }</a>&nbsp;
						{ lng('ACCEPT2')}
					</div>
				</div>	

				<div className="row text-center">
					<div className="col-12">
						<button type="submit" className="btn btn-success" name="submit" onClick={ handleLogin }>
							<em className="fas fa-check"></em>&nbsp;{ lng('OK') }
						</button>   
					</div>
				</div>	
				<br /><br />
				<div className="row text-center">
				<div className="col-12">
						<a href="'https://netpolgar.hu/auth/facebook?state='+SITEURL+'/'+atob(redirect)"
							className="link"> 
							{ lng('FBLOGIN') }			
						</a>
					</div>
					<div className="col-12">
						<a href="'https://netpolgar.hu/auth/google?state='+SITEURL+'/'+atob(redirect)" 
							className="link"> 
							{ lng('GOOGLELOGIN') }			
						</a>
					</div>	
				</div>	
			</form>
			<div className="alert alert-info">{ lng('REGISTHELP2') }</div>
			<div className="row">
				<div className="col-12 text-center">
					<var  onClick={ () => {setTask('regist')} } className="link">
							{ lng('DOREGIST') }
					</var>
				</div>
			</div>
			<div className="row">
				<div className="col-12 text-center">
					<var className="link">
							{ lng('RESEND_ACTIVATOR') }
					</var>
				</div>
			</div>
			<div className="row">
				<div className="col-12 text-center">
					<var className="link">
							{ lng('FORGET_PASSWORD') }
					</var>
				</div>
			</div>
		</div>
  );
};

export default Login;
